import React from "react";

function PersonalInfo({ nextPage }) {
  return (
    <div>
      <h3 className="text-xl font-semibold mb-4">Personal Information</h3>
      <label className="block mb-2">
        Name:
        <input type="text" placeholder="Enter your name" className="w-full px-3 py-2 border border-gray-300 rounded mt-1" />
      </label>
      <label className="block mb-4">
        Email:
        <input type="email" placeholder="Enter your email" className="w-full px-3 py-2 border border-gray-300 rounded mt-1" />
      </label>
    </div>
  );
}

export default PersonalInfo;
